	image: { objectFit: 'cover', cursor: 'pointer' },
});

const PhotoListDetail = ({ image, showImage }) => {
	const classes = useStyles();
	const { urls, description, blur_hash } = image;

	const renderImageDetail = () => {
		return (
			<div>
				<span style={{display: "inline-block", background: `transparent url('https://blurhash-decoder.function.cloud/?blurhash=${b}') 0 0 / 100% 100%`}}>
					<img
						className={classes.image}
						onClick={() => showImage(image)}
						src={blur_hash}
						alt={description}
						style={{ width: '100%', height: '15.625rem' }}
					/>
				</span>
			</div>
		);
	};
	if (image.urls.regular) {
		return renderImageDetail();
	} else {
		return <span>No images yet</span>;
	}
};

export default PhotoListDetail;
